import * as url from "url";

export const theme = {
    colors: {
        primaryBg: '#2C2C2C',
        secondaryBg: '#414141',
        accent: '#00C4F0',
        additional: '#E29500',
        border: '#686868',

        font: '#E4E4E4',
    }
}


export const fonts = {
    font: {
        primary: url,
        secondary: "'Arodora', sans-serif",
        third: '"nicomoji", sans-serif',
    }
}
